import { Container, Grid, Paper } from '@material-ui/core';

const Coding = () => {
    return (
        <Container fixed>
            <Grid container>
                <Grid item xs={12} fullWidth>
                    <Title>Coding expiriens</Title>
                </Grid>
            </Grid>
        </Container>
    );
};

export default Coding;

const Title = styled.p`
    margin-top: 0rem;
    color: white;
    font-size: 4rem;
`;
